import React from 'react'
import '../css/App.css';
function TopNav() {
  return (
    <div className='topnav'>
        <ul className='topmenu'>

            <li  className='option'>Email</li>
            <li  className='option'>Phone</li>
            <li  className='option'>call</li>
            <li  className='option'>about</li>
            <li className='option'>search</li>
        </ul>
    </div>
  )
}

export default TopNav
